import Navbar from './components/Navbar';
import ProductList from './components/ProductList';
import ProductDetails from './components/ProductDetails';


class App extends Component {
  render(){
  return (
    <React.Fragment>
      <Navbar/>
      <ProductList/>
      <ProductDetails/>

    </React.Fragment>
  );
}
}

export default App;
